// import { ref } from "firebase/database";
import { useEffect, useState } from "react";
import { database, ref, onValue } from "./FirebaseSettings";
import { Link } from "react-router-dom";

const StreamSession = () => {
  const [streamSessions, setStreamSessions] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const dataRef = ref(database, "users"); // Change to your data path
    const subscribeEvent = onValue(
      dataRef,
      (snapshot) => {
        setStreamSessions(snapshot.val());

        setLoading(false);
      },
      (error) => {
        setError(error);
        setLoading(false);
      }
    );
    // console.log(streamSessions);
    return () => subscribeEvent();
  }, []);
  if (loading) {
    return <p>Loading...</p>;
  }

  if (error) {
    return <p>Error: {error.message}</p>;
  }
  return (
    <div className="stream-sessions">
      {/* <p>Hello World</p> */}
      {Object.keys(streamSessions).map((key) => (
        <div className="stream-links" key={key}>
          {/* <a href={key}>
            {key}
          </a> */}
          <Link to={`/${key}`}>
            <h2>{key}</h2>
          </Link>
          {/* <br></br> */}
        </div>
      ))}
    </div>
  );
};

export default StreamSession;
